import React from 'react';
import TodoItem from './TodoItem';

interface TodoListProps {
  todos: Todo[];
}

const TodoList: React.FC<TodoListProps> = ({ todos }) => {
  return (
    <div>
      {todos.map((todo) => {
        <TodoItem todo={todo} />;
      })}
    </div>
  );
};

export default TodoList;
